      firstName:"",
      lastName:"",
      email:"",
      password:""
    })
    const dispatch=useDispatch()
    const navigate=useNavigate()
  const loading=useSelector(state=>state.AuthReducer.loading)
  const handlechange=(e)=> {
    setUserInfo({...userInfo,[e.target.name]:e.target.value})
  }
